// Implementation
export async function pipe<const I, const O>(
	input: I,
	...fns: ReadonlyArray<MaybeAsyncUnaryFunction<I, O>>
): Promise<O> {
	let acc: I | O = await input;
	for (const fn of fns) acc = await fn(acc as I);
	return acc as O;
}
